var b=[{id:1,topic:"Garments Digital",description:"This is part of my sixth semester at Code & Context. We are working on a digital Space, enabling the User to prototype their own garments, with the use of three.js. We are hoping to democratize the process of designing clothing, both in the digital and analog world.",date:"28-03-2022",link:"https://garments.digital/",tag:"development"},{id:2,topic:"CoENV",description:"COENV is part of Project Launch. This project emerged from the 5th semester of Code & Context initiated by Kathia von Roth. CoENV aims at creating a better work environment. CUBE, SIGILS and ROOMBOARD are different modules of the COENV. Together they create the ecosystem. This is a DIY project, so feel free to take a look at our README. If you would like to take a look at our work-process, join our spaces channel.",date:"03-12-2021",link:"https://www.coenv.space/",tag:"IOT"},{id:3,topic:"Birds on bikes",description:"IOT & Tensorflow project, being part of the 4th semester. We developed a DIY Bird Cam, being able to detect Birds automaticly with the use of tensorflow. Simultaneously we created a website, giving space to people building their very own bird cam. This can be seen as a community & social space.",date:"18-6-2021",link:"https://github.com/Erpix3lt/BirdsOnBikes",tag:"IOT"},{id:4,topic:"Temperature display",description:"A diy weather station, consisting of a esp 32 and various adafruit parts. The weather station will livestream usefull information to a localhost website.",date:"18-6-2021",link:"https://github.com/Erpix3lt/Temperature_Display",tag:"IOT"},{id:5,topic:"B - Seite",description:"F\xFCr den Sch\xF6ngeist-Beitrag dieser Woche haben Maximilian Schmalenbach und Frederik Stilke ihre pers\xF6nlichen Fotoarchive durchst\xF6bert, um analoge Fotografien mit Filmfehlern zu finden. Die Selektion der Bilder zeigt, dass diese jedoch trotz ihrer offensichtlichen [...] Fotografien und Kuration: Frederik Stilke & Maximilian Schmalenbach",date:"23-01-2021",link:"https://www.schoengeistmagazin.de/blog/xyryvpdnyfry3xgakk0bs73ll2xnv0",tag:"photography"},{id:6,topic:"Dirk Schmalenbach",description:"This is a web development project, designing and building a portfolio web page for my fathers architecture office.",date:"17-04-2020",link:"https://www.architekt-schmalenbach.de/",tag:"web-development"},{id:7,topic:"Gr\xFC\xDFe aus Bonn!",description:"Dass Bonn keine Weltstadt ist, braucht man wohl niemandem zu erz\xE4hlen. Und dennoch hat es seine Ecken und Kanten, die eine fast schon romantische Sicht auf die ehemalige Hauptstadt der Bundesrepublik Deutschland zul\xE4sst. Diese festzuhalten ist unseren SCH\xD6NGEIST-Fotografen Maximilian Schmalenbach und Frederik Stilke gelungen.",date:"01-08-2020",link:"https://www.schoengeistmagazin.de/blog/gre-aus-bonn",tag:"photography"}];const s={less:"less than a minute read",default:"min read"},r={less:"moins d'une minute de lecture",default:"min de lecture"},l={less:"menos de un minuto leyendo",default:"min de lectura"},d={less:"\u5C0F\u4E8E\u4E00\u5206\u949F",default:"\u5206\u949F"},u={less:"1\u5206\u672A\u6E80\u306E\u8AAD\u307F\u53D6\u308A",default:"\u6700\u5C0F\u8AAD\u307F\u53D6\u308A"},c={en:s,fr:r,es:l,cn:d,ja:u},h=e=>{var t;return(t=e.match(/[\w\d\s,.\u00C0-\u024F]+/giu))!==null&&t!==void 0?t:[]},p=e=>{var t;return(t=e.match(/[\u4E00-\u9FA5]/gu))!==null&&t!==void 0?t:[]},g=e=>{var t;return(t=e.match(/[\u3041-\u3096]/gu))!==null&&t!==void 0?t:[]},m=e=>h(e).reduce((t,i)=>t+(i.trim().length?i.trim().split(/\s+/u).length:0),0)+p(e).length+g(e).length,o=e=>e<1+Number.EPSILON,f=(e,t="en")=>c[t][o(e)?"less":"default"],w=(e,t=300,i="en")=>{const a=m(e!=null?e:""),n=+Math.round(a/t).toFixed(2);return{minutes:n,words:a,text:`${o(n)?"":n} ${f(n,i)}`.trimStart()}};export{b,w as r};
